function Footer() {
  return (
    <div className="footer">
      <div className="footer__content">
        <p className="footer__content-left">
          © 2010-2018 <br />
          Торговая марка «Свит»
        </p>
        <p className="footer__content-right">Пользовательское соглашение</p>
      </div>
    </div>
  );
}

export default Footer;
